import React from "react";
import { EINPROGRESS } from "constants";

export default function PageMarkup() {
  return (
    <Page title="Charity Name">
      <Layout>
        <Layout.AnnotatedSection title="Charity Name" destion="Our Website URL">
          <Card sectioned>
            <Form Layout>
              <TextField
                label="Identification Number"
                disabled
                value={"680259824"}
              />
              <TextField
                type="Location"
                disabled
                value={"Arcata, California"}
              />
            </Form>
          </Card>
        </Layout.AnnotatedSection>
      </Layout>
    </Page>
  );
}
